package com.twinflag.touch.model;import javax.persistence.*;import java.util.Date;@Entity@Table(name = "t_level_two")public class LevelTwoBean {    @Id    @GeneratedValue(strategy = GenerationType.AUTO)    private String id;    @Column(name = "updatetime")    private Date updateTime;    @ManyToOne    @JoinColumn(name = "level_one_id")    private LevelOneBean levelOne;    private String label;    private String title;    private String url;    @Column(name = "ismany")    private boolean isMany;    @ManyToOne    @JoinColumn(name = "update_user")    private UserBean updateUser;    @ManyToOne    @JoinColumn(name = "create_user")    private UserBean createUser;    @Column(name = "createtime")    private Date createTime;    public String getId() {        return id;    }    public void setId(String id) {        this.id = id;    }    public String getLabel() {        return label;    }    public void setLabel(String label) {        this.label = label;    }    public String getTitle() {        return title;    }    public void setTitle(String title) {        this.title = title;    }    public String getUrl() {        return url;    }    public void setUrl(String url) {        this.url = url;    }    public boolean isMany() {        return isMany;    }    public void setMany(boolean many) {        isMany = many;    }    public Date getUpdateTime() {        return updateTime;    }    public void setUpdateTime(Date updateTime) {        this.updateTime = updateTime;    }    public LevelOneBean getLevelOne() {        return levelOne;    }    public void setLevelOne(LevelOneBean levelOne) {        this.levelOne = levelOne;    }    public UserBean getUpdateUser() {        return updateUser;    }    public void setUpdateUser(UserBean updateUser) {        this.updateUser = updateUser;    }    public UserBean getCreateUser() {        return createUser;    }    public void setCreateUser(UserBean createUser) {        this.createUser = createUser;    }    public Date getCreateTime() {        return createTime;    }    public void setCreateTime(Date createTime) {        this.createTime = createTime;    }}